import React from "react";
import { Link } from "react-router-dom";
import "../style/Service.css";

function Service() {
  return (
    <div
      className="background"
      style={{
        backgroundImage: "url(./bgimg5.png)",
        backgroundSize: "cover",
        width: "92%",
        height: "auto",
        backgroundRepeat: "repeat-y",
      }}
    >
      <div className="Service">
        <div className="Left">
          <Link to="SignRecPage">
            <button className="LeftBtn">수어 인식</button>
          </Link>
        </div>
        <div className="Center">
          <Link to="ObjectRecPage">
            <button className="CenterBtn">사물 인식</button>
          </Link>
        </div>
        <div className="Right">
          <Link to="DocuRecPage">
            <button className="RightBtn">문서 인식</button>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default Service;
